import ExpenseForm from './ExpenseForm';

const NewExpense = () => {
    const newExpenseHandler = expense => {
        const newExpense = {
            ...expense,
            id : Math.random().toString()
        }

        console.log()
    }

    return (
        <div className = "new-expense">
            <ExpenseForm onSaveExpenseData = {newExpenseHandler} />
        </div>
    )
}

